        e.preventDefault();
        ref.current?.scroll
    };

    return (
        <nav>
            <ul>
                <li><a href="1" onClick={handle}>O mne</a></li>
                <li><a href="2">Moje projekty</a></li>
                <li><a href="3">Moje schopnosti</a></li>
